import React from 'react';

const NameGenerator = ({ selectedGender, selectedRace, selectedCulture, generateName, generateNames }) => {
  const handleGenerateName = () => {
    generateName();
  };

  const handleGenerateNames = () => {
    generateNames();
  };

  return (
    <div>
      <h2>Generated Names:</h2>
      <button onClick={handleGenerateName}>Generate Single Name</button>
      <button onClick={handleGenerateNames}>Generate 10 Names</button>
      <div>
        <p>Gender: {selectedGender}</p>
        <p>Race: {selectedRace}</p>
        <p>Culture: {selectedCulture}</p>
        {/* Display generated names here */}
      </div>
    </div>
  );
};

export default NameGenerator;
